class Patient {  String name ;  String lastname ;  String email ;  String password ;  String  phonenumber ;  String birthday ;  String sexe ;  String role ;  String promotion  ;  Patient({    this.name,    this.lastname,    this.email,    this.password,    this.phonenumber,    this.role,    this.promotion,    this.sexe,    this.birthday,  });  toJson() {    return {      "name" : this.name,      "lastname" :this.lastname ,      "role":this.role ,      "promotion":this.promotion ,      "sexe":this.sexe ,      "birthday":this.birthday ,      "phonenumber":this.phonenumber,      "password": this.password ,      "email":this.email    };  }  @override  String toString() {    return super.toString();  }}